import Head from 'next/head';
import Navbar from './Navbar';


const Layout = (props) => (
  <div>
    <Head>
      <title>CodeTunes</title>
    </Head>
    <Navbar/>
    {props.children}
    

    <style global jsx>{`
    
      * {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
      }

      body {
        background-color: purple;
      }
    
    `} 
    </style>
    
    <style jsx>{`
    
      

      



    `}</style>
  </div>
)

export default Layout;
